import React from 'react';
import burgerLogo from '../../assets/images/133 burger-logo.png';
import classes from './Logo.module.css';


const logo = (props) => (
    <div className={classes.Logo} st>
        <img src={burgerLogo} alt="burger logo"/>
    </div>
);

export default logo;
